column8:
「なかったことに!40代からのカロリーバランスサプリ 120粒」は、白インゲン豆・ヤムイモ・108種の植物発酵エキスなどを配合、アラフォーの壁を感じ始めた方のダイエットをサポートするサプリメントです。『なかったコトに!』から、大人なカロリーバランスサプリが登場。ミドル世代の取り戻したいアレコレに。健康的な毎日を応援します。<br><br>ご注意 <br>※食生活は、主食、主菜、副菜を基本に、食事のバランスを。<br>●薬を服用中あるいは通院中、妊娠中、授乳中の方は、お召し上がりになる前に、医師にご相談ください。<br>●乳幼児、小児の手の届かないところで保管ください。<br>●食物アレルギーのある方は、原材料名をご確認の上、お召し上がりください。<br>●体質・体調・飲み過ぎにより、まれにかゆみ、発疹、胃部不快感、下痢、便秘などの症状がでる場合があります。万一、体に異常を感じた場合は、ご使用を中止してください。<br>●過度なダイエットは危険です。バランスのとれた食事とともにご利用ください。<br>●本品は植物由来素材を使用しているため、色調に若干差が生じる場合がありますが、成分含有量や品質に問題はありません。<br>●品質保持のため、チャックをしっかり閉めて保管してください。ぬれた手で触るなどせず、衛生的にお取り扱い願います。<br>●開封後はなるべく早くお召し上がりください。<br>●乾燥剤が入っていますので、誤って召し上がらないようにご注意ください。<br>●安心してお召し上がりいただけるよう、商品の安全性には万全を期しておりますが、万一、品質に不都合がございましたらお取りかえいたします。<br>※イラスト・コピーはイメージであり効果効能を標榜するものではございません。<br>※「なかったコトに!」はグラフィコの登録商標です。<br><br>保存方法 <br>直射日光・高温多湿の場所を避けて保存してください。<br><br>原材料名・栄養成分等 <br>●名称：ワイルドヤムエキス末、白インゲン豆エキス含有食品<br>●原材料名：還元麦芽糖水飴、白インゲン豆エキス、マルトデキストリン、キダチアロエ末、食用卵穀粉、デキストリン、ワイルドヤムエキス末、α-リポ酸、ハス葉エキス末、L-オルニチン、L-カルニチンフマル酸塩、メリロートエキス末、サラシアレティキュラータエキス末、パン酵母(亜鉛・マンガン・銅・ヨウ素・セレン・クロム・モリブデン含有)、植物発酵食品、難消化性デキストリン、セルロース、L-アルギニン、L-グルタミン、酸化Mg、ステアリン酸Ca、二酸化ケイ素、ビタミンC、L-リジン、ビタミンB6、緑茶抽出物、抽出ビタミンE、ナイアシン、パントテン酸Ca、ビタミンB1、ビタミンB2、ビタミンA、葉酸、ビタミンD、ビタミンB12、(原材料の一部に卵、大豆、やまいも、りんご、バナナを含む)<br>●栄養成分表示/1回4粒(1120mg)あたり：エネルギー 4.16kcal、たんぱく質 0.28g、脂質 0.05g、炭水化物 0.66g、ナトリウム 1.68mg<br><br>お問い合わせ先 <br>グラフィコカスタマーセンター<br>フリーダイヤル：0120-498-177<br>販売者<br>株式会社グラフィコ<br>東京都品川区大崎1-6-1<br><br>内容量：33.6g(280mg×120粒)<br>1日量(目安)：4粒<br>約30日分<br>4580159011509 17390 ＊なかったコトに！４０代からのバランスサプリ　　　<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
