名称： ハーブティースリム <BR>原材料名： サンザシ、アズキ、インゲン、ウーロン茶、カシヤスティック、エビスグサ、カモミール <BR>内容量： 30包 <BR>使用上の注意： 妊婦・乳幼児は使用しないで下さい。 <BR>保存上の注意： 高温多湿・直射日光を避け 涼しい所に保管してください。 <BR>販　売元： やすらぎ園 <BR><BR>【おいしいお召し上がり方】 <BR>ティーカップ（180cc）に1包を入れて熱湯を注ぎ、10分ほど浸してからお飲み下さい。<BR>濃い目がお好みの方はスプーンでティーパックを数回押さえ下さい。<BR>又、5分ほど煎じてお飲みになっても構いません。 <br>ハーブティースリムは健康と美容を願う方のために野草を主に7種類の有効成分をブレンドした繊維飲料です。'優しく確実に'ということを目指し日本人の体質に合わせて開発した日本国産の野草茶です。ハーブティースリムは「くせになる」とか「量が増える」ということはありませんので安心してご利用いただけます。<br>■30包<br>■納期：3日-7日<br>※表記上の納期は、通常お届けとなります。<br>人気商品など変動の多い商品もございますので、<br>表記は目安としてご参考くださいますようお願い申し上げます。<br>広告文責：株式会社ノースウェブ　Tel 0144-52-0018<br><div id="migi-obi">

