品名：オールインワンダイエット<br>名称：白いんげん豆抽出物含有食品<br>内容量：90g（250mg×360粒）<br>成分<br>マルトース、デキストリン、キャンドルブッシュ末、L-カルニチン酒石酸塩、L-オルニチン塩酸塩、サラシアレティキュラータエキス末、白いんげん豆抽出物、コレウスフォルスコリエキス末、ジンジャーエキス、アカメガシワエキス末、セルロース、クエン酸、香料、ショ糖脂肪酸エステル、微粒二酸化ケイ素、甘味料（アスパルテーム・Lフェニルアラニン化合物）、キトサン、酸化マグネシウム、香辛料、（原材料の一部にかに・乳を含む）<br><br>お召し上がり方<br>１日あたり６粒を目安に水またはぬるま湯でお召し上がりください。（そのまま噛んでも美味しく召し上がれます）<br>お召し上がり時の注意<br>○開封後は、キャップをしっかり閉めてお早めにお召し上がりください。<br>○原材料表示をご参照の上、食品アレルギーのある方はご使用をお控えください。<br>○体質、体調により合わない場合はご使用を中止してください。<br>○妊産婦および授乳中の方はご使用をお控えください。<br>○乳幼児の手の届かないところに保管してください。<br>○本品は天然由来の原料を使用しておりますので色調等が異なる場合がありますが、品質には問題ありません。<br>○食生活は、主食、主菜、副菜を基本に、食事のバランスを。<br>製造国：日本<br>※通常1週間前後で配送の予定ですが、人気商品の為、商品欠品の場合、それよりもお時間をいただいたり、商品完売といったご連絡をさせていただくことがございます。ご了承くださいませ。
